// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract NftV1Collection is ERC1155, Ownable {

    uint256 private _tokenId = 0;
    string private _name;
    string private _symbol;
    mapping(uint256 => string) private _tokenURIs;

    constructor(address initialOwner, string memory name, string memory symbol) ERC1155("") Ownable(initialOwner) {
        _name = name;
        _symbol = symbol;
    }

    function setURI(string memory newuri) public onlyOwner {
        _setURI(newuri);
    }

    function _setTokenURI(uint256 tokenId, string memory _tokenURI) internal virtual {
        _tokenURIs[tokenId] = _tokenURI;
    }

    function mint(address to, string memory _tokenURI, uint256 value) external onlyOwner returns (uint256) {
        uint256 newItemId = _tokenId++;
        _mint(to, newItemId, value, "");
        _setTokenURI(newItemId, _tokenURI);
        return newItemId;
    }

    function mintUniqueNFT(address to, string memory _tokenURI, uint256 value) external  onlyOwner returns (uint256[] memory) {
       uint256[] memory ids = new uint256[](value);

       for(uint256 i = 0; i < value; i++) {
            uint256 newItemId = _tokenId++;
            _mint(to, newItemId, 1, "");
            _setTokenURI(newItemId, _tokenURI);
            ids[i] = newItemId;
       }

        return ids;
    }

    // to 사이즈와 value는 같아야 한다.
    function mintUniqueNFT(address[] memory to, string memory _tokenURI, uint256 value) external onlyOwner returns (uint256[] memory) {
       uint256[] memory ids = new uint256[](value);

       for(uint256 i = 0; i < value; i++) {
            uint256 newItemId = _tokenId++;
            _mint(to[i], newItemId, 1, "");
            _setTokenURI(newItemId, _tokenURI);
            ids[i] = newItemId;
       }

        return ids;
    }

    function name() public view returns(string memory) {
        return _name;
    }

    function symbol() public view returns(string memory) {
        return _symbol;
    }

    function tokenURI(uint256 tokenId) public view virtual returns (string memory) {
        return _tokenURIs[tokenId];
    }

    function tokenId() public view virtual returns (uint256) {
        return _tokenId;
    }
}

